      body: "This is largely a bug-fix and stability release, but also contains some
        fairly\r\nmajor internal refactoring, specifically to better support some
        future changes\r\nthat will make gomplate easier to use as a library!\r\n\r\nBe
        sure to check out the multi-platform Docker images available at [`hairyhenderson/gomplate`](https://hub.docker.com/r/hairyhenderson/gomplate).\r\n\r\n_If
        you've gained value out of gomplate and want to find a way to encourage development,
        please consider [sponsoring gomplate](https://github.com/sponsors/hairyhenderson)!_\r\n\r\n##
        [v3.9.0](https://github.com/hairyhenderson/gomplate/tree/v3.9.0) (2021-01-24)\r\n[Full
        Changelog](https://github.com/hairyhenderson/gomplate/compare/v3.8.0...v3.9.0)\r\n\r\n###
        Release Notes\r\n\r\n#### New features and changes\r\n\r\n- [\\#1056](https://github.com/hairyhenderson/gomplate/pull/1056)
        New `$GOMPLATE_LOG_FORMAT` environment variable to support [changing logging
        formats](https://docs.gomplate.ca/usage/#log-formatting) (fix for [\\#942](https://github.com/hairyhenderson/gomplate/issues/942))\r\n-
        [\\#1028](https://github.com/hairyhenderson/gomplate/pull/1028) The `hairyhenderson/gomplate:alpine`
        Docker image now ships with an uncompressed binary. Fix for [\\#1007](https://github.com/hairyhenderson/gomplate/issues/1007)\r\n\r\n<!--
        #### New functions -->\r\n\r\n#### Bug fixes\r\n\r\n- [\\#1051](https://github.com/hairyhenderson/gomplate/pull/1051)
        Fixing potential data race in signal handling code (possible when gomplate
        is used as a library)\r\n- [\\#1027](https://github.com/hairyhenderson/gomplate/pull/1027)
        & [\\#1043](https://github.com/hairyhenderson/gomplate/pull/1043) Fix ignored
        left/right delim env vars (fixes [\\#1018](https://github.com/hairyhenderson/gomplate/issues/1018))\r\n-
        [\\#1029](https://github.com/hairyhenderson/gomplate/pull/1029) & [\\#1041](https://github.com/hairyhenderson/gomplate/pull/1041)
        Only extra print newline with console output (fixes [\\#996](https://github.com/hairyhenderson/gomplate/issues/996))\r\n-
        [\\#956](https://github.com/hairyhenderson/gomplate/pull/956) Properly support
        Windows file modes (fixes [\\#948](https://github.com/hairyhenderson/gomplate/issues/948))\r\n\r\n####
        Documentation fixes/updates\r\n\r\n- [\\#981](https://github.com/hairyhenderson/gomplate/pull/981)
        Fixing docker image tag reference (fixes [\\#996](https://github.com/hairyhenderson/gomplate/issues/980))\r\n"
